Lego Disney Pixar Lightyear 76830 Zyclops Chase
Know a Space-Ranger-in-training who loves Buzz Lightyear? Make their day with the Zyclops Chase (76830) building toy. Fans can recreate scenes from the Disney and Pixar movie Lightyear – the definitive origin story of Buzz Lightyear – as they learn to build with LEGO® bricks. Buzz Lightyear’s minifigure wears a space suit and helmet, and the mech’s cool features include posable arms and legs and a disc shooter for dynamic battle fun.&nbsp;
Simple builds for little Space-Rangers-in-training&nbsp;LEGO 4+ sets come with clever features for a fun play experience. The Starter Brick provides a sturdy base for building, and there’s a figure in each bag of bricks so the role play can start before the set is completely built.&nbsp;
Top fun for families&nbsp;4+ gifts let adults share the building fun with kids. Grown-ups new to LEGO building needn’t worry – this collectible Buzz Lightyear buildable toy playset comes with picture instructions, making the process easy even for children who are only just starting to read.&nbsp;

Relive scenes from the definitive origin story of Buzz Lightyear – Treat boys and girls aged 4 and up to the Lightyear Zyclops Chase (76830) playset inspired by Disney and Pixar’s Lightyear&nbsp;
Buildable action toy for Buzz Lightyear fans – Creative set comes with LEGO® Buzz Lightyear and Izzy minifigures kitted out in spacesuit helmets and armor, a posable, buildable mech toy and 3 weapons&nbsp;
Save-the-day play – Buzz Lightyear fans enter a world of imaginative action and adventure as they move the buildable mech toy, launch his disc shooters and mobilize the heroes to win the battle&nbsp;
Gift for Buzz Lightyear fans aged 4 and up – LEGO® 4+ sets are quick to assemble and teach youngsters how to build, thanks to the inclusion of a Starter Brick and clear picture instructions&nbsp;
Birthday gift for play and display – Buildable mech toy stands over 4 in. (12 cm) tall, so it can be kept out on display in a room ready for anytime action fun&nbsp;
Fast fun – The set is quick to build thanks to a Starter Brick onto which other pieces are attached, plus easy-to-follow picture guides that are clear even for kids who don’t yet read&nbsp;
Bringing the exciting movie action home – Fans will love recreating scenes from Disney and Pixar’s Lightyear and will develop creative skills by inventing their own action-packed battles&nbsp;
Grow the intergalactic fun – Combines with Zurg Battle (76831) and XL-15 Spaceship (76832) to bring more action from the Disney and Pixar’s Lightyear movie to fans’ bedrooms&nbsp;
Consistent quality – Ever since 1958, LEGO® components have met rigorous industry standards to ensure they are consistent, compatible and connect and pull apart, time after time&nbsp;
Peace of mind at play – LEGO® building toys are tested to the max to ensure they meet rigorous safety standards

